import { useState } from 'react';
import './App.css';
import Form from './components/Form'
function App() {
    const [todoList, setTodoList] = useState([]);
    let add = (todo) =>{
        setTodoList([...todoList, todo])
    }
    return (
        <Form add = {add}/>
    )
}

export default App;
